able,Original,Comprehensive,Current and Cited.\n","\n","The data has proper license, does not contain the Personal Identifiable Information (PII) so privacy and security properly maintained. It is a open source data so it has free access, usage and sharing of data for all.\n","\n","Data integrity means the accuracy,completeness,consistency, and trustworthiness of data throughtout it's life-cycle. For verify this, we research about the company and the data lives within the company's own systems.\n","\n","The data has following variables/columns Trip start day and time,Trip end day and time,Trip start station,Trip end station,Rider type (Member, Single Ride, and Day Pass) so it will help answer our questions by process, analyze and making visualization from those data.\n","\n","The data is in raw format so i need to clean the data then i could perform the analysis.\n","\n","## Process Phase \n","\n","\n","I choose to work with R because the data is too large for working with Google Sheets or Excel.Also,with R it's easy to reproduce analysis, processing lots of data and creating data viz.\n","\n","Here,I have a data of different months in different csv files. Now, I want to merge all data in one place. To do that:"]},{"cell_type":"code","execution_count":14,"id":"edf7ae99","metadata":{"execution":{"iopub.execute_input":"2022-02-07T22:10:25.302116Z","iopub.status.busy":"2022-02-07T22:10:25.300314Z","iopub.status.idle":"2022-02-07T22:11:00.22189Z","shell.execute_reply":"2022-02-07T22:11:00.221404Z"},"papermill":{"duration":35.092623,"end_time":"2022-02-07T22:11:00.222004","exception":false,"start_time":"2022-02-07T22:10:25.129381","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["Rows: 5,595,063\n","Columns: 13\n","$ ride_id            \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m \"E19E6F1B8D4C42ED\", \"DC88F20C2C55F27F\", \"EC45C94683…\n","$ rideable_type      \u001b[3m\u001b[90m<chr>\u001b[39m\u001b[23m \"electric_bike\", \"el